import React, {useState} from 'react'
import WODForm from "./WODForm"




function WOD(props) {
    const {warmUp, strength, workout, coolDown, title} = props
    const [editToggle, setEditToggle] = useState(false)

    return (
        <div>
            {!editToggle ?props(
                <>
                    <h1>{title}</h1>
                    <ul>
                        <li>{warmUp}</li>
                    </ul>
                    <ul>
                        <li>{strength}</li>
                    </ul>
                    <ul>
                        <li>{workout}</li>
                    </ul>
                    <ul>
                        <li>{coolDown}</li>
                    </ul>
                    <button onClick={setEditToggle(prevToggle => !prevToggle)}>
                        Edit
                    </button>
                </>
            )
                :
                (
                <>
                <WODForm
                    title={title}
                    warmUp={warmUp}
                    strength={strength}
                    workout={workout}
                    coolDown={coolDown}
                 />
                </>
            )}
        </div>
    )
}

export default WOD
